Why deletion of element of embedded subdocument array using Mongoose JS isn't working?<p>1.) I have two models: Project and Action:</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const Schema = mongoose.Schema;

const ProjectSchema = new Schema({
  _id: Schema.Types.ObjectId,
  title: { type: String, default: &quot;default project title&quot; },
  deadline: { type: Date, default: &quot;2099-01-01T10:30&quot; },
  description: { type: String, default: &quot;default project description&quot; },
  actions: [],
});

module.exports = mongoose.model(&quot;Project&quot;, ProjectSchema);


const mongoose = require(&quot;mongoose&quot;);
const Schema = mongoose.Schema;

const ActionSchema = new Schema({
  _id: Schema.Types.ObjectId,
  type: { type: String, default: &quot;none&quot; },
  queued: { type: Boolean, default: false },
  description: { type: String, default: &quot;default description&quot; },
  complete: { type: Boolean, default: false },
  waitingFor: [],
  setting: { type: String, default: &quot;default setting&quot; },
  deadline: {type: Date, default: &quot;2099-01-01T10:30&quot;}
});

module.exports = mongoose.model(&quot;Action&quot;, ActionSchema);

</code></pre>
<p>2.) I have a service to <code>destroy</code> an <code>Action</code> which should <strong>both</strong> update <code>Project</code> actions subdocument array (i.e. delete the action) and delete the <code>Action</code> from its collection.</p>
<p>It receives an id of the Action to delete from the array.</p>
<p>3.) I've tried several approaches but the closest I've gotten is:</p>
<pre><code>require(&quot;../db&quot;);
const mongoose = require(&quot;mongoose&quot;);
const Action = require(&quot;../models/action&quot;);
const Project = require(&quot;../models/project&quot;);

const destroy = async (id) =&gt; {
  const filter = { _id: id };
  const action_id = mongoose.Types.ObjectId(id);
  const project_id = mongoose.Types.ObjectId(&quot;5fdcd4fdc0d61b7fe59f0940&quot;);

  Project.updateOne(
    {},
    {
      $pull: { actions: { _id: id } },
    },
    {
      arrayFilters: [{ &quot;i._id&quot;: mongoose.Types.ObjectId(id) }],

      new: true,
    }
  ).then((output =&gt; console.log(&quot;output of db op: &quot;, output)))

  Action.deleteOne(filter, function (err, output) {
    console.log(&quot;output of db op &quot;, output);
  });
};

</code></pre>
<p>The deletion of <code>Action</code> from its collection works but <code>Project</code> does not update its actions array. Currently, the output of the above is:</p>
<p>output of db op:  { n: 1, nModified: 0, ok: 1 } (It finds <code>Project</code> but doesn't update!</p>
<p>output of db op  { n: 1, ok: 1, deletedCount: 1 } (Successfully deletes from Action collection, but Project array is unmodified)</p>
<p>Any suggestions for how to successfully update <code>Project</code> is much appreciated. Thanks!</p>

