JavaScript - I try to fetch data to database but it return statusCode: 400<p>I have successfully implemented DS18B20 on Raspberry Pi with Gatsby frontend.
My next step, put all temperature data to the mongodb which I use STRAPI as a backend.
The following is my code in server.js</p>
<pre><code>const express = require('express');
const http = require('http');
const socketIO = require('socket.io');
const app = express();
const server = http.createServer(app);
const io = socketIO(server);
const ds18b20 = require('ds18b20');
const fetch = require('isomorphic-fetch');
const port = 4001;

const interval = 1000;

io.on('connection', (socket) =&gt; {
  var sensorId = [];

  ds18b20.sensors((err, id) =&gt; {
    sensorId = id;
    socket.emit('sensors', id);
  });

  setInterval(() =&gt; {
    sensorId.forEach((id) =&gt; {
      ds18b20.temperature(id, (err, value) =&gt; {
        socket.emit('temps', {'id': id, 'value': value});
      });
    });
  }, interval);

  setInterval(() =&gt; {
    sensorId.forEach((id) =&gt; {
      ds18b20.temperature(id, (err, value) =&gt; {
        var tempData = {
          temperature: value,
          date: new Date()
        };
        fetch('http://172.20.10.3:1337/weathers', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(tempData),
        })
        .then(response =&gt; response.json())
        .then(data =&gt; console.log(data))
        .catch(err =&gt; console.log(err));
      });
    });
  }, 10000);

});

server.listen(port, () =&gt; console.log(`Listening on port ${port}`));
</code></pre>
<p>It return the following log:</p>
<pre><code>Dec 20 23:47:41 raspberrypi node[5195]: {
Dec 20 23:47:41 raspberrypi node[5195]:   statusCode: 400,
Dec 20 23:47:41 raspberrypi node[5195]:   error: 'Bad Request',
Dec 20 23:47:41 raspberrypi node[5195]:   message: 'ValidationError',
Dec 20 23:47:41 raspberrypi node[5195]:   data: { errors: { temperature: [Array] } }
Dec 20 23:47:41 raspberrypi node[5195]: }
</code></pre>
<p>How can I fetch by using POST method to STRAPI?
Thank you very much in advance.</p>

