How to find index of maximum value in array with missing field in mongodb?<p>Here's a very simple data example below:</p>
<pre class="lang-py prettyprint-override"><code>[
  {
    &quot;data&quot;: [
      {
        &quot;uid&quot;: &quot;0&quot;,
        &quot;value&quot;: 0,

      },
      {
        &quot;uid&quot;: &quot;1&quot;,
        &quot;value&quot;: 1,

      },
      {
        &quot;uid&quot;: &quot;2&quot;,
        &quot;value&quot;: 2,

      }
    ]
  }
]
</code></pre>
<p>Then, I want to find the corresponding <code>uid</code> of maximum <code>value</code>. In my case, the result should be <code>&quot;2&quot;</code>.</p>
<p>Here is the query I'm playing with:</p>
<pre class="lang-py prettyprint-override"><code>db.collection.aggregate([
  {
    &quot;$project&quot;: {
      &quot;_id&quot;: 0,
      &quot;value_argmax&quot;: {
        &quot;$arrayElemAt&quot;: [
          &quot;$data.uid&quot;,
          {
            &quot;$indexOfArray&quot;: [
              &quot;$data.value&quot;,
              {
                &quot;$max&quot;: &quot;$data.value&quot;
              }
            ]
          }
        ]
      }
    }
  }
])
</code></pre>
<p>The code works find for my case. However, if there exists some missing fields, the query code may fail. For example, if I have a data example looks like below:</p>
<pre class="lang-py prettyprint-override"><code>[
  {
    &quot;data&quot;: [
      {
        &quot;uid&quot;: &quot;0&quot;,
        // &quot;value&quot;: 0, // missing field

      },
      {
        &quot;uid&quot;: &quot;1&quot;,
        &quot;value&quot;: 1,

      },
      {
        &quot;uid&quot;: &quot;2&quot;,
        &quot;value&quot;: 2,

      }
    ]
  }
]
</code></pre>
